import Pay from "./Pay"
import Success from "./Success"
import React from "react"
import { Route,Router, Switch } from "react-router-dom";

const App = () => {

    return (
        <Router>
            <Switch>
                <Route path="/pay" component={Pay}/>
                
                <Route path="/success">
                    <Success/>
                </Route>
            </Switch>
        </Router>
    );
};

export default App;
